import React from 'react';
import "./index.css";
import Logo from '../../assets/Logo.svg';
const Headder = ()=>{
    return(
        <div className="headder-container">
            <div className="headder-logo">
                <img src={Logo}/>
                <h1>TeraLab</h1>
            </div>
            <div className="headder-MenuGroup"></div>
        </div>
    )
}
export default Headder;
